INSERT INTO `news` (`id`, `category`, `headline`, `imgname`, `thumbnail`, `story`, `username`, `timestamp`, `approved`) VALUES
(15, 't', 'HTC Desire 10 Lifestyle Launched in India: Price, Release Date, Specifications, and More', 'htc_1475151332124.jpeg', , 'HTC on Thursday launched the Desire 10 Lifestyle in India. To recall, the company had first unveiled the smartphone alongside the Desire 10 Pro last week, and revealed it would hit select markets by September itself. It''s evident India is one of these markets, and the smartphone will go on sale at Rs. 15,990 via Amazon India and the company''s own e-store from Friday.\r\n\r\nThe highlight of the HTC Desire 10 Lifestyle and HTC Desire 10 Pro is their design. The company is touting the matte finish bodies and the metallic gold contours. Both HTC phones also come with BoomSound stereo speakers. The HTC Desire 10 Lifestyle will be available in Stone Black (seen above) and Polar White (seen below) colours in India, though the company had announced Royal Blue and Valentine Lux colour options for other markets.\r\n\r\nThe HTC Desire 10 Lifestyle runs Android 6.0 Marshmallow with the company''s Sense UI on top, and it will be available in a dual-SIM (Nano-SIM) variant in India. While the Desire 10 Lifestyle is the more basic version of the Desire 10 Pro, it brings support for 24-bit Hi-Res audio and HTC BoomSound Hi-Fi edition stereo speakers. It foregoes the fingerprint sensor seen on rear panel of the Desire 10 Pro however.\r\n\r\nThe HTC Desire 10 Lifestyle sports a 5.5-inch HD (720x1280 pixels) Super LCD display with Gorilla Glass protection and a pixel density of 267ppi. It is powered by a 1.6GHz quad-core Qualcomm Snapdragon 400 processor. It comes in two variants 2GB of RAM and 32GB inbuilt storage, and 3GB of RAM and 64GB inbuilt storage â€“ once again expandable via microSD card (up to 2TB).\r\n\r\nThe HTC Desire 10 Lifestyle bears a 13-megapixel rear camera with a BSI sensor and an f/2.2 aperture, while the front sports a 5-megapixel camera with a BSI sensor and an f/2.8 aperture. Connectivity options include Wi-Fi 802.11 b/g/n, GPS/ A-GPS, Bluetooth v4.1, and 4G LTE Cat.4 (with support for Band 40 used by some LTE networks in India). It sports a 2700mAh battery that''s rated to deliver up to 24 hours of talktime on 3G networks. The Desire 10 Lifestyle measures in at 156.9x76.9x7.7mm and weighs in at 155 grams.', 'root', '2016-10-01 11:28:18', 1);
INSERT INTO `news` (`id`, `category`, `headline`, `imgname`, `thumbnail`, `story`, `username`, `timestamp`, `approved`) VALUES
(16, 's', ' India vs New Zealand: Second Test following same script as first, after hosts turn rescue act on it', '36_201610011941_940x355.jpeg', , '"It was a not-so-good day for us," Ajinkya Rahane had said on Friday, after India ended the first day''s play at 239 for seven. The Indian vice-captain made it clear what he thought was a good first innings score on this variable Eden Gardens'' pitch, but it remained to be seen whether they would get 320.\r\n\r\nIf day one was about Indian batsmen making repeated mistakes, Saturday saw one of them putting his hand up, and wringing the match by the scruff of its neck. Playing at his home ground, Wriddhiman Saha rose to the challenge and put the game beyond New Zealand''s reach.\r\n\r\nThe visitors were missing Kane Williamson; the fact wasn''t lost on them that their batting order is weak in this Test, and their best chance lay in restricting India to about 250-odd. Trent Boult, Neil Wagner and Matt Henry adopted an aggressive strategy to get the Indian tail out cheaply. Except it didn''t work.\r\n\r\nNew Zealand eventually dismissed Jadeja with the short ball. Given the unpredictable bounce, Saha too received a blow on his left forearm, a stinging delivery from Henry that he ducked into. He didn''t ask for an arm guard, or the physio for that matter. He didn''t lose his composure, merely deflected the ball to the boundary, for he had a job to do.\r\n\r\nCricketers all around the world revere Eden Gardens, so one can only imagine what it means to Saha. This has been his stepping-stone to international cricket. The inspiration in his knock was evident, as he stepped out to smack a six off Mitchell Santner to bring up India''s 300 as well as his 50. In the previous series against West Indies, he had scored his maiden hundred and dug his team out of a massive hole at St Lucia. Here, in a different situation, despite the disparity in runs scored, the importance of Saha''s innings cannot be undervalued.\r\n\r\nThereafter, it was New Zealand''s weakness in batting that shone through. If the Indian top-order played a couple of loose shots, the visitors returned the favour several times over. It didn''t help that they had just under half an hour to face before lunch, and it played in Kohli''s hands that he could deploy his pacers for extended spells on either side of the break. and duly then, Mohammed Shami and Bhuvneshwar Kumar wreaked havoc.\r\n\r\nBarring the Black Caps'' top-order collapse though, in many aspects, this Test has unfolded in entirely the same way as the first one in Kanpur. In the first Test, rain arrived around tea-time and nearly washed out the final session of day two, the same as here. The Cricket Association of Bengal is a tad richer than the Uttar Pradesh Cricket Association, however, and as such put its better resources â€” huge covers and three Super Soppers â€” to work.\r\n\r\nAs such, when play resumed, albeit for a short period of time, India were able to exert more pressure. Kohli proved his mettle once again as a thinking captain, putting on his pacers to make use of the fresh-again pitch. It also augured well that failing light would certainly force him to deploy his spinners at some point. By that time, however, Bhuvi already did the damage with his maiden five-wicket haul on Indian soil, as New Zealand lost 3 for 43 in 9.2 overs.\r\n\r\nReturning from injury in that same St Lucia Test, and picking a match winning five-wicket haul, the medium pacer had stressed upon the importance of fitness on his game. Thanks to the same, he is now able to work up more pace, and moving the ball at that speed makes him lethal in such conditions. Kohli has understood how he wants to use this weapon in his arsenal, and we might not see Bhuvi deployed too often, only when the conditions are right. He will never be over-bowled in a Test series again.\r\n\r\nThe Kiwis will feel hard done by, especially with the LBW decision against Luke Ronchi. But, on this day, they were up against two players who have now grown resolutely confident in their game over time.\r\n\r\nIf Saha has been a tale of freeing up the mind to allow his natural game, then with Bhuvi, it has been all about revitalization. Together, the duo turned the game for India after a near-disastrous day one.', 'root', '2016-10-01 17:41:58', 1);
INSERT INTO `news` (`id`, `category`, `headline`, `imgname`, `thumbnail`, `story`, `username`, `timestamp`, `approved`) VALUES
(17, 's', 'Premier League roundup: Liverpool comeback stuns Swansea, Diego Costa-inspired Chelsea win', 'Diego-Costa-Chelsea-celebrates-Twitter@ChelseaFC.j', , ' James Milner''s 84th-minute penalty earned Liverpool a gritty 2-1 victory at Swansea City on Saturday that saw Jurgen Klopp''s side climb to second place in the Premier League table.\r\n\r\nLeroy Fer gave struggling Swansea an eighth-minute lead, but Roberto Firmino equalised early in the second half before Milner claimed the winner following a foul on Firmino by Angel Rangel.\r\n\r\nChelsea ended a three-game winless run with a 2-0 win at Hull City that provisionally lifted Antonio Conte''s men to sixth, while Dimitri Payet''s memorable goal earned West Ham United a 1-1 draw with Middlesbrough.\r\n\r\nDespite Liverpool''s fourth straight league win, manager Klopp said: "I was very angry. I have lost a lot of football games, but today makes no sense.\r\n\r\n"We were not ready and it is my responsibility. It was not good. The build-up was too static, no movement.\r\n\r\n"We were never compact enough and we lost a lot of balls. We got better in the second half and when we let the ball roll it became difficult for Swansea.\r\n\r\n"The second half was better, but still not brilliant."\r\n\r\nLiverpool finished the day two points adrift of leaders Manchester City, who visit third-place Tottenham Hotspur on Sunday.\r\n\r\nFer broke the deadlock by converting from close range after Borja Baston had knocked down a corner at the back post.\r\n\r\nLiverpool then lost Adam Lallana to a groin injury, with Daniel Sturridge coming on.\r\n\r\nThe visitors levelled in the 54th minute, Firmino directing a header into the bottom-left corner from Jordan Henderson''s lobbed pass after Philippe Coutinho''s free-kick struck the wall.\r\n\r\nCosta curls in\r\n\r\nAfter Rangel bundled into the back of Firmino, Milner chipped his penalty down the middle to condemn Swansea to a fifth defeat in six games, piling the pressure on manager Francesco Guidolin.\r\n\r\nManchester United great Ryan Giggs and ex-United States manager Bob Bradley have been linked with fourth-bottom Swansea this week, but Guidolin turned a deaf ear to the speculation.\r\n\r\n"This not my problem," said the Italian. "My job is to work with the players and prepare the team for games. I am worried for the table, not my position. It is not good. We need more points."\r\n\r\nBeaten by Liverpool and Arsenal in their previous two games, Chelsea bounced back with a 2-0 success over Hull at the KCOM Stadium.\r\n\r\nWillian and Diego Costa scored Chelsea''s goals inside six second-half minutes, both players curling shots into the bottom-right corner.\r\n\r\nConte''s men drew level on points with fifth-place Arsenal, who visit Burnley on Sunday.\r\n\r\nFrance international Payet further endeared himself to West Ham''s fans with a sensational equaliser against Boro to prevent Slaven Bilic''s team succumbing to a fifth straight league defeat.\r\n\r\nCristhian Stuani headed Boro in front early in the second half, but West Ham levelled in the 57th minute when Payet waltzed across the box from the left, beating four defenders, before drilling home.\r\n\r\nWatford and Bournemouth played out an entertaining 2-2 draw at Vicarage Road.\r\n\r\nBournemouth twice went in front, through Callum Wilson and substitute Joshua King, but Watford equalised on each occasion courtesy of captain Troy Deeney and substitute Isaac Success.\r\n\r\nPatrick van Aanholt''s 83rd-minute equaliser earned Sunderland manager David Moyes a measure of respite in a 1-1 draw at home to West Bromwich Albion, who had gone ahead through Nacer Chadli.', 'root', '2016-10-01 17:46:09', 1);
INSERT INTO `news` (`id`, `category`, `headline`, `imgname`, `thumbnail`, `story`, `username`, `timestamp`, `approved`) VALUES
(18, 't', 'Google Pixel phones launched, India prices begin at Rs. 57,000', '02f9ed05c8d826e7557c17f38eee3bd7fd13ebf6.jpeg', , 'Google Pixel, Pixel XL smartphones are all set to be unveiled by the search giant at a special event in San Francisco. Googleâ€™s big launch will see two new smartphones with the new Pixel branding, and a more premium pricing than the previous Nexus phones.\r\n\r\n\r\nGoogle has finally unveiled the Pixel smartphones at its event in San Francisco. The smartphones are powered by Qualcomm Snapdragon 821 SoCs, and house 4GB of LPDDR4 RAM. The two phones will each be available in 32GB and 128GB storage variants. The smaller Google Pixel houses a 5-inch Full HD AMOLED display, while the larger Pixel houses a 5.5-inch, 2K resolution AMOLED display. The 5-inch Pixel houses a 2770mAh battery, while the 5.5-inch Pixel houses a 3450mAh battery. Google has also claimed that the Pixel phones have the "best smartphone camera" ever, exhibiting a DXOMark camera rating of 89, which is supposedly the highest ever for a smartphone camera. The cameras will come with multiple enhancements include HDR+ mode, larger pixel size on sensor, and an f/2.0, 6-element lens. Interestingly, Google also found it relevant to mention that the phones do have a 3.5mm audio jack. ', 'root', '2016-10-06 13:52:35', 1);
INSERT INTO `news` (`id`, `category`, `headline`, `imgname`, `thumbnail`, `story`, `username`, `timestamp`, `approved`) VALUES
(19, 'sc', '''Westworld'' Review: HBO''s Sci-Fi Western Is Must-See TV', 'Westworld-1-1200x809.jpg', , '"These violent delights have violent ends\r\n\r\nAnd in their triumph die, like fire and powder,\r\n\r\nWhich, as they kiss, consume."\r\n\r\n~William Shakespeare, from Romeo and Juliet\r\n\r\nImagine that technology was so advanced, you could step into a wholly immersive virtual reality world that was very nearly as real as our own. A theme park, where you can live out your fantasies. No awkward headsets to wear. No fuzzy graphics. Because itâ€™s all realâ€”for the most part.\r\n\r\nYou can buy drinks at the local saloon, or pay for sex with one of the AI prostitutes at the bar. You can get in gun fights with outlaws, or save the town from murderous highwaymen. Or, if you really want to, you can go to a farm house, kill the elderly parents there and rape their daughter.', 'root', '2016-10-06 14:09:08', 1);
INSERT INTO `news` (`id`, `category`, `headline`, `imgname`, `thumbnail`, `story`, `username`, `timestamp`, `approved`) VALUES
(20, 'sc', 'Wolverine next film is going to be called â€˜Loganâ€™', 'Screen-Shot-2016-10-05-at-17.23.01-616x466.png.jpg', , '    Now might be a good time to talk about the â€˜fightsâ€™ described in the next 100 or so pages. Basically, if youâ€™re on the make for a hyper choreographed, gravity defying, city-block destroying CG fuckathon, this ainâ€™t your movie.\r\n\r\n    In this flick, people will get hurt or killed when shit falls on them. They will get just as hurt or just as killed if they get hit with something big and heavy like, say, a car. Should anyone in our story have the misfortune to fall off a roof or out a window, they wonâ€™t bounce. They will die.\r\n\r\n    As for our hero, well, heâ€™s older now and itâ€™s clear his abilities arenâ€™t what they once were. Heâ€™s fading on the inside and his diminished healing factor keeps him in a constant state of chronic pain â€“ hence booze as a painkiller.\r\n\r\nLogan will be Jackmanâ€™s last Wolverine film before he hangs up his claws for good. Rather appropriately, the film is set to revolved around the â€˜Wolverine: Old Man Loganâ€˜ storyline, in which Logan is, um, an old man.\r\n\r\nThe film also stars Patrick Stewart (X-Men) as Charles Xavier, as well as Richard E Grant (Bram Stokerâ€™s Dracula), Elizabeth Rodriguez (Orange Is The New Black), Boyd Holbrook (Narcos), Doris Morgado (Colony) and Stephen Merchant (Hello Ladies). Michael Green (American Gods) and David James Kelly wrote the screenplay.', 'root', '2016-10-06 14:11:07', 1);
INSERT INTO `news` (`id`, `category`, `headline`, `imgname`, `thumbnail`, `story`, `username`, `timestamp`, `approved`) VALUES
(21, 't', 'Hereâ€™s Everything Google Announced On Hardware Event', 'Made-By-Google-Event-Pixel-October-796x408.png', , 'It seems like only yesterday that Google was just a software company. Search and web apps, Android and Chrome. The industry giantâ€™s first moves into hardware were small; it first worked with partners like Samsung and LG to build phones, tablets, and Chromebooks, then timidly branched out into creating its own designs. Well, Google isnâ€™t timid about hardware any longer. In a 100-minute event on Tuesday, the company unveiled an entire line of products made not by hardware partners, but by Googleâ€™s own robust in-house product teams. And connecting all of the pieces together, of course, is Googleâ€™s speech-controlled, AI-powered Assistant. Hereâ€™s everything the company unveiled.\r\n\r\nPixel and Pixel XL Phones\r\nWith aluminum frames, glass backs, and no camera protrusions, Googleâ€™s first Pixel-branded phones are pretty slick. Whatâ€™s more important is whatâ€™s on the inside: An unprecedented amount of AI, a powerful Qualcomm Snapdragon 821 processor, Daydream-ready VR status, and one hell of a smartphone camera (more on that next). The 5-inch Pixel and 5.5-inch Pixel XL are available for preorder today at $649 and up in the US. You can buy them straight from Google, or you can walk into a Verizon store and pick one up too.\r\n\r\nThat Camera Tho!\r\nSpec-wise, the Pixelsâ€™ cameras look decent: 12-megapixel sensors, f/2.0 lenses, and handy modes for HDR stills and burst shooting. But according to DxO Mark, the sum of all those parts is actually the best phone camera of all time. With a rating of 89, it leapfrogged excellent shooters like the Samsung Galaxy S7 Edge and iPhone 7 to land at the top of the mobile rankings. The 4K video modeâ€™s gyroscope-based stabilization also looks great, and you get unlimited storage of your full-res shots and videos on Google Photos.\r\n\r\nDaydream View Headset\r\nGoogle VP of VR Clay Bavor says this new headset helps make VR simpler, friendlier, and more accessible. Softer, too! Made of flexible, breathable microfiber, Googleâ€™s googles look more like sweatpants than a VR headset. Theyâ€™re designed to fit comfortably over glasses, and thereâ€™s no wire required to sync up your phone. Oh, and the simple Daydream Controller stores inside the headset, too. Itâ€™ll be available for $79 in slate gray in November, with red and white versions coming later.\r\n\r\nNew Daydream VR Toys\r\nThe Daydream platform will also offer plenty of new VR stuff to get lost in. There will be a Fantastic Beasts And Where to Find Them VR experience from the Harry Potter universe in which youâ€™ll get to use the Daydream Controller as a magic wand. Thereâ€™s a new Starchart VR app for exploring space, and a new Gunjack 2 spaceship game for fighting in it. Youâ€™ll be able to watch movies in a private virtual theater in the Netflix, HBO, and Hulu apps, and thereâ€™s even a VR version of Google Street View.\r\n\r\nGoogle Home\r\nThe cute little Amazon Echo competitor goes on sale for $129 today and ships on November 4. Google spent a lot of time talking about all the things the built-in Google Assistant can do, like play music from YouTube or Spotify, queue up streaming Netflix or Hulu videos, and answer your spoken questions. The company also trumpeted the designâ€”it is very nice, with a touch-sensitive panel on top and swappable bases that come in a selection of colors and finishes.\r\n\r\nNew 4K Chromecast\r\nAs youâ€™d expect, the new Chromecast Ultra now supports streaming videos in 4K resolution. But there are a few surprises with Googleâ€™s latest dongle, and theyâ€™re great: The new streamer supports both HDR10 and Dolby Vision HDR video, and thereâ€™s an Ethernet port to handle the heavier load of data. Google Play Movies will start offering 4K content next month, joining Netflix, Vudu, and YouTube as supported 4K services. Priced at $69, the new Chromecast drops in November.\r\n\r\nGoogle Assistant Everywhere\r\nThe main thread running through all of todayâ€™s announcements is the Google Assistant. The voice-activated helper is the next big push for Google, and the company demonstrated how itâ€™s applying all of its machine learning knowledge to make the Assistant smarter and more useful. â€œIt helps find the stuff in your own world,â€ according to CEO Sundar Pichai, via voice searches for your schedule, photos, travel plans, movie listings, and dinner reservations. Thatâ€™s also a new name, Assistant with a capital A. No more OK Google or Google Now; itâ€™s just Assistant.\r\n\r\nGoogle Wi-Fi\r\nLooks like last yearâ€™s OnHub router was just the start. Google Wi-Fi is a new home networking product. With several access points to blanket the home, the modular and expandable Wi-Fi hardware system lets you add units to increase coverage. (If it sounds and looks like Eero, thatâ€™s because itâ€™s very similar.) Googleâ€™s Network Assist manages and optimizes network automatically, and transitions your devices from access point to access point as you wander around. There are new ways to manually manage usage, too, like the ability to pause Wi-Fi during dinner or throttle your kidsâ€™ usage. Itâ€™ll cost $129 for a single pack, or $299 for a 3-pack. Preorders start in November, and the units ship in December.', 'root', '2016-10-08 14:43:47', 1);

